         new google.maps.InfoWindow({content:string,disableAutoPan: true}).open(marker.getMap(), marker);
         window.external.IconClick(time, acc_x,acc_y,acc_z,speed,consumption_energy,lost_energy);
     });

         window.external.IconRightClick(time);
     });
